import React, { useState, useEffect } from "react";
import axios from "axios";

function FormularioVenta({ onVentaRegistrada }) {
  const [productos, setProductos] = useState([]);
  const [clientes, setClientes] = useState([]);
  const [vendedores, setVendedores] = useState([]);

  const [formData, setFormData] = useState({
    producto: "",
    cantidad: 1,
    moneda: "ARS",
    sucursal: "",
    cliente: "",
    vendedor: ""
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [resProd, resClientes, resVendedores] = await Promise.all([
          axios.get("http://localhost:5000/api/productos"),
          axios.get("http://localhost:5000/api/clientes"),
          axios.get("http://localhost:5000/api/vendedores") // o usuarios con rol vendedor
        ]);
        setProductos(resProd.data);
        setClientes(resClientes.data);
        setVendedores(resVendedores.data);
      } catch (err) {
        console.error("❌ Error al cargar datos:", err);
      }
    };
    fetchData();
  }, []);

  const handleChange = (e) => {
    setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/api/ventas", formData);
      alert("✅ Venta registrada con éxito");
      setFormData({
        producto: "",
        cantidad: 1,
        moneda: "ARS",
        sucursal: "",
        cliente: "",
        vendedor: ""
      });
      if (onVentaRegistrada) onVentaRegistrada();
    } catch (err) {
      console.error("❌ Error al registrar venta", err);
      alert("Error al registrar la venta.");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="bg-white p-6 rounded shadow-md mb-8">
      <h2 className="text-xl font-semibold mb-4">Registrar Venta</h2>

      <select name="producto" value={formData.producto} onChange={handleChange} className="w-full mb-2 p-2 border rounded" required>
        <option value="">Seleccione un producto</option>
        {productos.map((p) => (
          <option key={p._id} value={p._id}>{p.nombre} ({p.stock})</option>
        ))}
      </select>

      <input type="number" name="cantidad" value={formData.cantidad} onChange={handleChange} min={1} className="w-full mb-2 p-2 border rounded" required />

      <select name="moneda" value={formData.moneda} onChange={handleChange} className="w-full mb-2 p-2 border rounded">
        <option value="ARS">ARS</option>
        <option value="USD">USD</option>
      </select>

      <input type="text" name="sucursal" placeholder="Sucursal" value={formData.sucursal} onChange={handleChange} className="w-full mb-2 p-2 border rounded" />

      <select name="cliente" value={formData.cliente} onChange={handleChange} className="w-full mb-2 p-2 border rounded" required>
        <option value="">Seleccione un cliente</option>
        {clientes.map((c) => (
          <option key={c._id} value={c._id}>{c.nombreApellido}</option>
        ))}
      </select>

      <select name="vendedor" value={formData.vendedor} onChange={handleChange} className="w-full mb-4 p-2 border rounded" required>
        <option value="">Seleccione un vendedor</option>
        {vendedores.map((v) => (
          <option key={v._id} value={v._id}>{v.nombre}</option>
        ))}
      </select>

      <button type="submit" className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700 w-full">
        Registrar Venta
      </button>
    </form>
  );
}

export default FormularioVenta;
